// src/News.tsx
import React from 'react';
import './News.css';
import Button from '../Button/Button';
import backgroundImage from './background-image.png'; // Укажите путь к вашему изображению

const News: React.FC = () => {
    return (
        <div className="news-container" style={{ backgroundImage: `url(${backgroundImage})` }}>
            <div className="background-image">
                <img src="/logo.jpg" alt="Logo" className="logo" />
                <div className="background-container">
                    <div className="main-text-container"></div>
                    <div className="custom-background">
                        <div className="date-info-container">
                            Форум молодых работников угольной промышленности
                        </div>
                        <div className="date-info-container">
                            Сахалинская область, Углегорский район, г. Шахтерск
                        </div>
                        <div className="date-info-container1">
                            28-31 мая 2025 года
                        </div>
                    </div>
                    <Button text="Новости" onClick={() => console.log("Контакты")} />
                </div>
            </div>
        </div>
    );
}

export default News;
